import React from 'react';
import EventCard from '../components/EventCard';

const featuredEvents = [
  {
    title: 'Rust Tournament 2023',
    date: '15 de junio, 2023',
    description: '¡Compite por la gloria y premios en el torneo anual de Rustaco!'
  },
  {
    title: 'Rust Community Meetup',
    date: '20 de julio, 2023',
    description: 'Encuentro de entusiastas para compartir estrategias y experiencias.'
  },
  {
    title: 'Rust Game Development Workshop',
    date: '10 de agosto, 2023',
    description: 'Aprende a desarrollar juegos en Rust con expertos de la industria.'
  }
];

const Home = () => (
  <main>
    <h2>Eventos Destacados</h2>
    <div className="event-list">
      {featuredEvents.map((event, index) => (
        <EventCard key={index} {...event} />
      ))}
    </div>
  </main>
);

export default Home;
